import React from "react";

const quickLinks = (props) => (
    <div>
        <ul>
            <li><a href={props.link} />About Us</li>
            <li><a href={props.link} />Services</li>
            <li><a href={props.link} />Appoinment</li>
            <li><a href={props.link} />Contact</li>
        </ul>
    </div>
)

export default quickLinks;
